import React from "react";

const ShoppingCart = ({ items }) => {
  return (
    <div>
      <h1>Shopping Cart</h1>
      <div>
        {items.map((item) => (
          <div>
            <h4>{item.name}</h4>
            <img src={item.img} width="200" />
            <ul>
              <li>Price: ${item.price}</li>
              <li>Quantity {item.quantity}</li>
              <li>Subtotal: {}</li>
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export { ShoppingCart };
